import React from 'react';
import FontAwesome from 'react-fontawesome';

const CardInfo = (props) => {
    return (
        <div className={styles.cardInfo}>
            <span className={styles.teamName}>
                Team
            </span>
            <span className={styles.data}>
                <FontAwesome />
            </span>
        </div>
    );
};

export default CardInfo;
